import React from "react";
import "./productstyles.css";

import Data from "./Data";
import Productdata from "./productdata";

const Product = () => {
  const homeProducts = Data.slice(0, 4); // Slicing the data to get the first four products

  return (
    <div className="product">
      <h1> Trending Products</h1>
      <div className="product-list">
        {Data.map((product) => (
          <Productdata
            key={product.id}
            image={product.image}
            title={product.title}
            des={product.des}
            price={product.price}
            color={product.color}
            size={product.size}
          />
        ))}
      </div>
    </div>
  );
}

export default Product;
